import React from "react"
import SideNav, { Toggle, Nav, NavItem, NavIcon, NavText } from '@trendmicro/react-sidenav';
import { useAuth } from "../contexts/AuthContext"
import { Link ,  useNavigate } from "react-router-dom"

import '@trendmicro/react-sidenav/dist/react-sidenav.css';

export default function Sidebar() {

    const navigate = useNavigate();

    return (
        <Router>
            <Route render={({ location }) => (
                <React.Fragment>
                    <SideNav
                        onSelect={(selected) => {
                            const to = '/' + selected;
                            if (location.pathname !== to) {
                                navigate(to);
                            }
                        }}
                    >
                        <SideNav.Toggle />
                        <SideNav.Nav defaultSelected="home">
                            <NavItem eventKey="home">
                                <NavIcon>
                                    <i className="fa fa-fw fa-home" style={{ fontSize: '1.75em' }} />
                                </NavIcon>
                                <NavText>
                                    Home
                                </NavText>
                            </NavItem>
                            <NavItem eventKey="summarizer">
                                <NavIcon>
                                    <i className="fa fa-fw fa-device" style={{ fontSize: '1.75em' }} />
                                </NavIcon>
                                <NavText>
                                    Summarizer
                                </NavText>
                            </NavItem>
                            <NavItem eventKey="predict">
                                <NavIcon>
                                    <i className="fa fa-fw fa-device" style={{ fontSize: '1.75em' }} />
                                </NavIcon>
                                <NavText>
                                    Predict
                                </NavText>
                            </NavItem>
                        </SideNav.Nav>
                    </SideNav>
                    <main>
                        <AuthProvider>
                            <Route
                                exact="true"
                                caseSensitive={false}
                                path="/"
                                element={
                                <PrivateRoute>
                                    <Home />
                                </PrivateRoute>
                                }
                            />
                            <Route
                                caseSensitive={false}
                                path="/home"
                                element={
                                <PrivateRoute>
                                    <Home />
                                </PrivateRoute>
                                }
                            />
                            <Route
                                caseSensitive={false}
                                path="/summarizer"
                                element={
                                <PrivateRoute>
                                    <Summarizer />
                                </PrivateRoute>
                                }
                            />
                            <Route
                            caseSensitive={false}
                                path="/predict"
                                element={
                                <PrivateRoute>
                                    <Predict />
                                </PrivateRoute>
                                }
                            />
                        </AuthProvider>
                    </main>
                </React.Fragment>
            )}
            />
        </Router>
    );

}
